import React from 'react';
import './Auth.css';
import { REGISTRATION_ROUTE } from '../utils/consts';

const Auth = () => {

    
    return (
        <div id='auth-box' className='d-flex justify-content-center align-items-center'>
            <div class="card">
                <h1 className='mx-auto mt-3 mb-0'>Авторизация</h1>
                <div class="card-body d-flex flex-column">
                    <input placeholder='Введите ваш email...' className='mt-1' />
                    <input placeholder='Введите ваш пароль...' className='mt-3' />
                    <div className='d-flex justify-content-between'>
                        <a className='text-decoration-underline text-secondary mt-2' href={REGISTRATION_ROUTE}>Зарегистрироваться</a>
                        <button type="button" className='btn btn-success mt-3'>
                            Войти
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Auth;
